import React from 'react';
import { useState } from 'react';

const Contador = () => {
    const [numero,setNumero] = useState(0);
    return (
        <div>
            <h3>Mi primer componente: {numero}</h3>
            <button onClick={()=>{setNumero(numero + 1)}}>Aumentar!</button>
        </div>
    );
}

export default Contador;
